import React from "react";
import ReactDOM from "react-dom";

class MyHeader extends React.Component {
  render() {
    return (
      <>
        <div>
          {" "}
          <a href="https://webmastershisar.com/">Logo</a>
        </div>
        <div>
          <ul>
            <li>Home</li>
            <li>About Us</li>
            <li> Contact Us</li>
          </ul>
        </div>
        <div>trying to write a new website in react</div>
      </>
    );
  }
}
export default MyHeader;
